import React from 'react';

const Jubilacion = () => {
    return (
        <>
            <div className="jubilacion-container">
                <h1 className="jubilacion-title">Jubilacion</h1>
                {/* Aquí puedes añadir el contenido específico del componente Plan de Jubilación */}
                <div className="jubilacion-content">
                    {/* Contenido adicional */}
                </div>
            </div>
        </>
    );
};

export default Jubilacion;
